description:
Frank is a looser cab driver with a hot girlfriend - Jennie. The day of their anniversary he fucks up (again) and she finally dumps him. Frank decides to kill himself, but then the Devil\\\'s son appears, offering him a deal - to get Jennifer back in exchange for his soul. The devil\\\'s plan is simple - shape-shifting into celebrities to make Frank popular and Jennifer - jealous. Unfortunately the devil\\\'s son find\\\'s out he\\\'s gay and decides to have Franky all for himself.

Excellent German comedy, now with subs.

